response.about:
Я живу, не стремясь стать знаменитым и известным;
Я живу и действую, не﻿ говоря лишних слов;
Я живу и радуюсь тому, как прохожу дистанцию, а не месту на пьедестале;
Я живу жизнью, в которой есть и чёрные и белые полосы;
Я живу и чувствую каждый удар моего сердца, а не только яркие моменты;
Я живу в каждом движении моего тела, а не в сидении в роскошном автомобиле;
Я живу будущим, а не тем, что было;
Мы живём спортом !
